    "7416501": {
        "Desc": "Entrez dans le courant.",
        "Talk": [
            [
                {
                    "N": "Narzissenkreuz",
                    "T": "#Je sens la « raison » s'éveiller en moi. Vous êtes {M#les successeurs}{F#les successeures} du Narzissenkreuz ou une menace ?"
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Vous avez dégainé votre épée contre moi. Il semble que la réponse soit évidente."
                },
                {
                    "N": "Ann",
                    "T": "Narzissenkreuz..."
                },
                {
                    "N": "_1005",
                    "T": "Hum ? C'est Narzissenkreuz ?"
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Maintenant que vous avez entendu parler de moi, vous devriez comprendre ma mission de sauver le monde. Dès que vous avez entendu mon nom, l'étincelle du salut s'est allumée en vous."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "#Il semble que vous ayez été {M#dupés}{F#dupées} par des mensonges, d'où votre hostilité. Je n'ai pas le loisir de gaspiller mon énergie."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Réjouissez-vous, applaudissez. Après tout, je vais répondre à toutes vos questions, je vais tout vous montrer. Maintenant, rendez-moi la sainte lame, puis partez d'ici pour rejoindre un lieu sûr."
                },
                {
                    "N": "_1005",
                    "T": "On ne peut pas vous donner la sainte lame."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Quelle stupidité, mais je vous pardonne et je vais vous sauver."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Je ressens également cela, bien que les quatre Orthants aient été inversés, l'image entière de l'arbre d'émanation n'est pas encore achevée."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Ce n'est plus possible de sauver tout le monde. Je vais étendre ma compassion au maximum, au prix de ma propre vie."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Si je peux n'en sauver que certains, j'essayerai d'en sauver le plus grand nombre possible."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Maintenant, je viens prendre la sainte lame."
                }
            ]
        ]
    },
