    "7416502": {
        "Desc": "Avancez.",
        "Talk": [
            [
                {
                    "N": "Narzissenkreuz",
                    "T": "#Impossible... J'aurais dû atteindre le stade de «{NON_BREAK_SPACE}non retour ». Comment ai-je pu revenir dans cet état ?"
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Et j'ai complètement perdu le contrôle sur la mer primordiale."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Pourquoi ? Pourquoi ça s'est produit ? Pourquoi avez-vous fait cela ?"
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Le nouveau monde ne peut pas naître, tout le monde est condamné à mourir dans le rêve !"
                },
                {
                    "N": "_1005",
                    "T": "Ce serait préférable pour vous de vous réveiller de votre propre rêve."
                },
                {
                    "N": "_1005",
                    "T": "Le problème de la fin du monde doit être résolu par tous les habitants de la planète."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Je comprends, la sainte lame n'est pas de mon côté. Elle ne me soutient pas. Au contraire, à chaque mouvement, elle coupe les volontés des êtres qui m'entourent."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Finalement, ma faible nature humaine est revenue en moi."
                },
                {
                    "N": "_0",
                    "T": "L'inondation de la mer primordiale ne se produira pas si rapidement."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "J'ai constaté que les valeurs initiales de la formule mondiale ont été changées."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Qui contrôle la force vitale et qui a ouvert le royaume des bêtes ?"
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Il y a également une autre « variable » : vous."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "#{M#Destiné}{F#Destinée} à être le témoin de la défaite de la baleine dévoreuse, le témoin de tout."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Ah, je vois ! C'était donc ça !"
                },
                {
                    "N": "_0",
                    "T": "La créature a été vaincue."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "J'ai constaté que les valeurs initiales de la formule mondiale ont été changées. Une variable a été introduite dans ce monde."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Les objets venant de l'extérieur de l'univers ne peuvent pas tous être appelés « apparition » ou « variable »."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "J'avais négligé une autre « variable » : vous."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "#Le témoin, l'archiviste et {M#le concepteur}{F#la conceptrice} de tout."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Seul celui qui vaut un monde à lui-même peut prétendre à ce titre."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "J'ai rêvé de devenir une personne comme vous, mais ce rêve vient de se briser."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Tout ce que j'ai fait a été vain. Un rêve vide."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Encore moins qu'un rêve, même. Les rêves ne font pas de mal, au moins. Mais je... Non, vous et les autres... ont tellement souffert à cause de mes actes."
                },
                {
                    "N": "Ann",
                    "T": "Narzissenkreuz."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Ah, c'est vous. Je ne vous avais même pas remarquée."
                },
                {
                    "N": "Ann",
                    "T": "Pouvez-vous me dire qui je suis ?"
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Les noms ne sont que des étiquettes, mais je connais bien les deux couleurs qui constituent votre âme."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "La directrice Lyris ne sait pas ce qui s'était passé, elle se contente de tenir dans ses bras Mary-Ann, qui était à peine en vie."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Elle ne comprenait pas les complexités du présent ou du futur, et voulait juste rester dans le passé. Alors, elle a fait ce qu'elle pouvait."
                },
                {
                    "N": "Ann",
                    "T": "Je m'appelle Ann."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Eh bien, bonjour Ann."
                },
                {
                    "N": "Ann",
                    "T": "Je suis prête à vous pardonner."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Arrêtez de dire n'importe quoi. Depuis le début, mon objectif a été noble et sacré, sans une once d'égoïsme."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Personne ne peut me juger ou me condamner. Je n'ai pas besoin d'être pardonné."
                },
                {
                    "N": "Ann",
                    "T": "Peut-être que votre intention est noble, mais votre folie a blessé beaucoup de gens."
                },
                {
                    "N": "Ann",
                    "T": "Vous n'avez même pas rempli correctement l'équation. Qu'y a-t-il de mal à faire une erreur et de se faire pardonner ?"
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "... Vous avez raison. Je suis désolé."
                },
                {
                    "N": "Ann",
                    "T": "Narzissenkreuz, rentrez avec nous. Vous avez besoin de voir d'autres personnes."
                },
                {
                    "N": "_1005",
                    "T": "Il est plutôt coopératif, mais ce genre de demande..."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Pas de problème."
                },
                {
                    "N": "_1005",
                    "T": "Hein ? D'habitude, s'ensuit une lutte intérieure et une longue persuasion, non ?"
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Comme je l'ai dit, je ne ressens aucune culpabilité. Bien que notre projet ait échoué, le monde a quand même été sauvé."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Laissez les autres me blâmer et se moquer de moi. Mon cœur est vide. Il ne me reste qu'un seul désir."
                },
                {
                    "N": "_1005",
                    "T": "De quoi s'agit-il ?"
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Je veux revenir au début, avant que les héros du Narzissenkreuz ne commencent leur voyage."
                },
                {
                    "N": "Narzissenkreuz",
                    "T": "Cependant, ce n'est plus possible. Le destin des êtres humains ne dépend pas d'eux-mêmes, et je suis maintenant privé du pouvoir de contrôler mes propres rêves."
                },
                {
                    "N": "Ann",
                    "T": "#Chevalier {NICKNAME}, une fois que vous serez {M#prêt}{F#prête}, allons sceller à nouveau la mer primordiale avant de quitter cet endroit."
                }
            ]
        ]
    },
